import React from 'react';
import "./Mega.css"

export default props => {
    return(
        <div className='Mega'>
            <h2>Mega Sena - Surpresinha</h2>
            <div>
                <label htmlFor="bilhete"></label>
                <input type="number" />
            </div>
            <button onClick={this.state.gerarNumeros()}>Gerar</button>
        </div>
    )

}
